import { useState, useEffect } from 'react';
import '../App.css';
import './Form.css';

function Form() {
    const [form, setForm] = useState(false);
    const [formData, setFormData] = useState({});

    useEffect(() => {
        // Fetch the plugin_config from the extension
        // Assuming the extension provides the data asynchronously
        fetchPluginConfig()
            .then(pluginConfig => {
                // Create the form data based on the pluginConfig
                const initialFormData = createFormDataFromPluginConfig(pluginConfig);
                setFormData(initialFormData);
            }).catch(error => console.error('Error fetching plugin config:', error));
    }, []);

    const fetchPluginConfig = async () => {
        try {
            // Make the API call to fetch the plugin config
            // Replace the URL with the actual endpoint
            const response = await fetch(`http://127.0.0.1:5000/apps/Instagram/config`);
            const data = await response.json();
            console.log(data);
            return data.plugin_config; // Assuming plugin_config is the required data
        } catch (error) {
            console.error('Error fetching plugin config:', error);
            return null; // Return null in case of error
        }
    };

    const createFormDataFromPluginConfig = (pluginConfig) => {
      const formData = {};
      if (pluginConfig && Object.keys(pluginConfig).length > 0) {
          Object.keys(pluginConfig).forEach(key => {
              formData[key] = {
                  gender: '',
                  key: '',
                  name: ''
              };
          });
      } else {
          console.error('Plugin config is not in the expected format.');
      }
      return formData;
  };

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        setFormData(prevData => ({
            ...prevData,
            [name]: type === 'checkbox' ? checked : value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle form submission here, e.g., send data to server
        console.log(formData);
    };

    return (
        <div className='main-container'>
        {
            !form ? 
            <div style={{ textAlign: 'right', cursor: 'pointer' }}>
            <svg onClick={() => setForm(!form)} xmlns="http://www.w3.org/2000/svg" width="40" height="40" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="lucide lucide-settings">
                <path d="M12.22 2h-.44a2 2 0 0 0-2 2v.18a2 2 0 0 1-1 1.73l-.43.25a2 2 0 0 1-2 0l-.15-.08a2 2 0 0 0-2.73.73l-.22.38a2 2 0 0 0 .73 2.73l.15.1a2 2 0 0 1 1 1.72v.51a2 2 0 0 1-1 1.74l-.15.09a2 2 0 0 0-.73 2.73l.22.38a2 2 0 0 0 2.73.73l.15-.08a2 2 0 0 1 2 0l.43.25a2 2 0 0 1 1 1.73V20a2 2 0 0 0 2 2h.44a2 2 0 0 0 2-2v-.18a2 2 0 0 1 1-1.73l.43-.25a2 2 0 0 1 2 0l.15.08a2 2 0 0 0 2.73-.73l.22-.39a2 2 0 0 0-.73-2.73l-.15-.08a2 2 0 0 1-1-1.74v-.5a2 2 0 0 1 1-1.74l.15-.09a2 2 0 0 0 .73-2.73l-.22-.38a2 2 0 0 0-2.73-.73l-.15.08a2 2 0 0 1-2 0l-.43-.25a2 2 0 0 1-1-1.73V4a2 2 0 0 0-2-2z" />
                <circle cx="12" cy="12" r="3" />
            </svg>
        </div>
        :
        <div style={{ textAlign: 'right', cursor: 'pointer' }}>
       <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="lucide lucide-x"><path d="M18 6 6 18"/><path d="m6 6 12 12"/></svg>
    </div>
        }
            {form && <div>
    <form onSubmit={handleSubmit}>
            <div className='container'>
        {Object.entries(formData).map(([key, value]) => (
            <div className='form-container' key={key}>
                <label></label>
                <input className='input' type="text" name={`${key}.gender`} value={value.gender}  onChange={handleChange} />
                <input className='input' type="text" name={`${key}.key`} value={value.key}   onChange={handleChange} />
                <input className='input' type="text"  name={`${key}.name`} value={value.name}    onChange={handleChange} />
            </div>
        ))} 
        <button className='btn' type="submit">Submit</button>
            </div>
